    false,nt"url": null,nt"notes": "This map displays optical validation observation
    locations and percent coverage of scleractinian coral overlaid on bathymetry and
    landsat imagery. Optical data were collected by CRED TOAD camera sled aboard the
    Hawaiian Islands Humpback Whale National Marine Sanctuary small boat R/V Kohola
    cruise SB1505, NOAA small boat R/V AHI cruise MP1401, NOAA ship Hi'ialakai cruise
    HA0905 and aboard NOAA ship Oscar Elton Sette cruise SE0807. Data were also collected
    with Hawaii Undersea Research Laboratory's (HURL) RCV-150 remotely operated vehicle
    (ROV) on HURL R/V Ka`imikai-o-Kanaloa cruise's KOK0409, KOK0209, and KOK1207.",nt"license_title":
